Among the fields of Nintendo Switch Lite, an OG Nintendo Switch appears. 🙂 
I have been on a bit of Undertale again on the Nintendo Switch (doing the right run this time 🙈) & I plan on trying out the demo for Ori and the Blind Forest today ❤ I love that game, but a little disappointed that there isn't going to be a physical. I'm still happy that Microsoft allowed this to happen, along with Cuphead. .
A lot of TLOU 2 news all over my Instagram lately. It was one of the first games I played on the PS4 (TLOU) and I'm a little excited 🙃 I havent seen much of the trailers or anything, but I'm wondering if the enemies will be as creepy as those clickers 👀
